import React from "react";
import AddUser from "./Components/Users/AddUser";
import UserList from "./UserList/UserList";
let users = [];

function App() {
  const createUser = (inf) => {
    users.push(inf);
  };

  return (
    <div>
      <AddUser onInfHandler={createUser} />
      <UserList users={users} />
    </div>
  );
}

export default App;
